mh.add(3).multiply(4).divide(6).result();
mh.x =7;
console.log(`Nilai Sekarang : ${mh.x}`);
mh.multiply(2).multiply(Pi).result();
mh.x=7;
mh.square().multiply(Pi).result();
mh.x=4;
mh.exponent(3).result();
mh.squareRoot().result();

